The second volume of this brand new series brings a dramatic tale of tragedy and forbidden desire. Bree Daniels plays a tormented girl, devastated by the death of her stepmom. Her devious stepsister, played by Sara Luvv, seems unaffected. Bree suspects that her sister could be responsible...but is she? Or is Bree slowly losing her mind? Cherie DeVille plays the family's attorney and Dana Vespoli plays the doomed mother.

